import { Container, Row, Col } from 'react-bootstrap';
import { Icon } from '@iconify/react';
import Stack from 'react-bootstrap/Stack';

export default function Contact() {
    return (
        <Container className=''>
            <Row>
                <h1 className='mb-3'>/contact</h1>
            </Row>
            <Stack gap={4}>
            <Row>
                <a><Icon href="https://www.linkedin.com/in/yung-chu-chuang/" icon="akar-icons:linkedin-box-fill" />Yung-Chu Chuang</a>
            </Row>

            <Row>
                <a><Icon href="#" icon="ic:round-email" />yungchu1219@gmail.com</a>

            </Row>

            <Row>
                <a><Icon href="#" icon="ant-design:phone-filled" />(773) 231-2717</a>
            </Row>
            </Stack>

        </Container>
    )
}
